                                    </DropdownMenu>
                                </UncontrolledButtonDropdown>
                            </div>
                        </CardHeader>
                        <CardBody>
                            <ReactTable
                                data={data}
                                columns={[
                                    {
                                        Header: "Name",
                                        columns: [
                                            {
